import styled from 'styled-components';
import img from '../../assets/cash-register.jpg'




export const BannerWrapper = styled.div`
  width:100%;
  min-height:600px;
  border:2px solid black;
  position:relative;
`;

export const BannerText = styled.div`
  width:300px;
  height:200px;
  position:absolute;
  top:50%;
  left:50%;
  transform:translate(-50%,-50%);
  h2{
    text-align:center;
  }
`;
